.order-steps {
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 800px;
  margin: 40px auto;
  position: relative;
}

.step {
  display: flex;
  flex-direction: column;
  align-items: center;
  position: relative;
}

.step-indicator {
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background-color: #fff;
  border: 2px solid #ccc;
  display: flex;
  align-items: center;
  justify-content: center;
  font-family: "Roboto", sans-serif;
  font-weight: bold;
  color: #666;
  margin-bottom: 10px;
  transition: all 0.3s ease;
}

.step.active .step-indicator {
  background-color: #2c2f11;
  border-color: #2c2f11;
  color: yellowgreen;
}

.step.completed .step-indicator {
  background-color: #2c2f11;
  border-color: #2c2f11;
}

.check-icon {
  color: yellowgreen;
}

.step-title {
  font-family: "Roboto", sans-serif;
  font-size: 14px;
  color: #666;
  text-align: center;
}

.step.active .step-title {
  color: #2c2f11;
  font-weight: bold;
}

.step-line {
  position: absolute;
  top: 20px;
  right: -50%;
  width: 100%;
  height: 2px;
  background-color: #ccc;
  z-index: -1;
}

.step.completed .step-line {
  background-color: #2c2f11;
}
